🎥Directed by: Christopher Nolan
🕰Runtime: 2hrs 44mins
🎥Plot: After 8 years The Batman must return to save Gotham City from the grasps of a mercenary by the name of Bane.
🎥Rating: 10/10 😱
🎬Review: The Dark Knight Rises is the last instalment in the terrific Dark Knight trilogy.
It is also in my opinion the best out of the whole trilogy.
This is for a number of factors:
1. Tom Hardy as Bane - Every time Bane is on screen I get excited. He’s terrifying and it really freaks me out😂
2. The Runtime - With a 2hr and 44min runtime you don’t ever check your phone to see how much longer is left, in fact I wouldn’t have minded if it reached the 3hr mark.
3. The scale of things - Sure in the Dark Knight, Joker blew up a few things but in The Dark Knight Rises Bane threatens to blow up the whole city. With higher stakes it makes this film a whole lot more intense and extremely dark.
4. The Score - This isn’t just got this film but rather for this whole trilogy and it’s the electrifying score that gives the film an amazing superhero feel to it.
5. The Cinematography - The Dark Knight Rises is captured beautifully, with stills that I would want to hang on my walls.
6. Christian Bale - Arguably the best Batman to come to the big screen
7. The ending - I won’t say what happens but it’s a very satisfying end to an amazing trilogy 
Christopher Nolan has delivered one of the greatest trilogies of all time and I hope that Matt Reeves will live up to his standards with The Batman coming out next year.
